const Footer = () => {
    return (
        <div className="border-t-2 border-white my-[1000px]">
            <div>
                <p>Our Community</p>
            </div>
            <div>
                <p>About Us</p>
            </div>
            <div>
                <p>FAQ</p>
            </div>
        </div>
    );
};

export default Footer;
